import UseWeatherAPI from './weatherAPI.js'

export default function DisplayWeather(){
    const [weather, setWeather] = useState([])
    const [days, setDays] = useState([])

    const weatherInput = (data) => {
        setWeather(data)
        setDays(data.days[0])
        console.log(weather)
        console.log(days)
    }
return(
    <div>
       <UseWeatherAPI weatherInput={weatherInput}/>
        
    </div>
)



}
